import '../Css/Footer.css';
function Footer() {
    return (
        <footer className='footer'>
            <p className='footer-message'>The webApplication allows users to select their desired Application, Respurces and Raw data,<br /> and get additonal information via clicking a button!</p>

            <small >Created by Amir Tavahin</small>
        </footer>
    );
}



export default Footer;
